function balloonFlower_creatOut() {
  let newDiv = document.createElement('DIV');
  newDiv.id = 'balloonFlower_divOut';
  document.body.appendChild(newDiv)
}
function balloonFlower_getBezier(pointArr, time) {
  let nn = pointArr.length;
  let pascalTriangleArr = balloonFlower_getPascalTriangle(nn);
  let point = {
    'x': 0,
    'y': 0
  };
  let xAdd = 0;
  let yAdd = 0;
  for (let n = 0; n < nn; n++) {
    let a = (pascalTriangleArr[n]);
    let b = (nn - (n + 1));
    xAdd += a * (window.Math.pow((1 - time), b)) * (window.Math.pow(time, n)) * pointArr[n].x;
    yAdd += a * (window.Math.pow((1 - time), b)) * (window.Math.pow(time, n)) * pointArr[n].y
  }
  point.x = xAdd;
  point.y = yAdd;
  return point
}
function balloonFlower_createBezierTravel(pointArr) {
  let arr = [];
  let pointNum = 20;
  let timeUnit = 1 / pointNum;
  for (let io = 1; io <= pointNum; io++) {
    arr.push(balloonFlower_getBezier(pointArr, timeUnit * io))
  }
  return arr
}
